import React from 'react';

const Icon = ({
  name,
  fill = 0,
  weight = 400,
  grade = 0,
  size = 24,
  className = '',
  style,
  title,
  ...rest
}) => {
  const mergedStyle = {
    fontVariationSettings: `'FILL' ${fill}, 'wght' ${weight}, 'GRAD' ${grade}, 'opsz' 24`,
    fontSize: size,
    lineHeight: 1,
    ...style,
  };

  const ariaProps = title || rest['aria-label'] ? {} : { 'aria-hidden': true };

  return (
    <span
      className={`material-symbols-rounded ${className}`.trim()}
      style={mergedStyle}
      title={title}
      {...ariaProps}
      {...rest}
    >
      {name}
    </span>
  );
};

export default Icon;
